@Giấc Hoè
- Giấc mộng ở nước Hoè An, đây chỉ giấc ngũ
- Dị Văn lục: Mé nam nhà Thuần Vu Phần có cây Hoè to, họ Thuần thường ngồi uống rượu dưới gốc cây Hoè đó. Có một lần uống say, Thuần Vu Phần về nhà nghĩ, nằm mộng thấy 2 sứ giả đến nói: "Hoè An quốc vương sai tiểu thần mời ngài lên xe đi đến nước Hoè An." Thế rồi 3 người lên xe, nhắm phía cây Hoè mà ruỗi đến. Đến nơi, vào một cửa thành lớn màu đò, trên có chữ đề: "Đại Hoè An Quốc". Vua gã công chúa cho, phong Vu Phần làm thái thú quận Nam Kha. Bấy giờ, họ Vu thật cực kỳ giàu sang, vinh hiển. Khi tỉnh dậy, tìm đến gốc cây hoè thì chỉ có một hang tổ kiến, trong hang có một con to hơn cả đầu đỏ, cánh trắng. Vu Phần mới ngẫm ra: Đó là nước Hoè An và vua của nước ấy. Còn trên một cái hang ở tận trong cùng, về phía nam cây hoè, có một cành là rườm rà mới biết đó là quận Nam Kha (Cành cây mé nam). Do đó, dùng "Giấc hoè", "Giấc Nam Kha" để nói công danh phú quý là hư ảo, đời người ngắn ngũi như một giấc mộng

